script: |
  super -f text -I q12573.spq | sort > q12573.out

inputs:
  - name: q12573.spq
    data: |
      SELECT - col1 FROM tab1 (FORMAT parquet) WHERE NOT - - 25 IN ( - 33, + col2, col1 * + col1, - - col0 + + + 61 - col1 * 78 );
  - name: tab1

outputs:
  - name: q12573.out
    data: |
      -14
      -47
